import React from 'react';
import Nav from '../components/Nav'
import Main from "../components/Main";
import Contents from "../components/Contents";

const index=()=>{
    return(
        <div>
            <Nav/>
            <Main/>
            <Contents/>
            <Main/>
            <Main/>
            <Main/>
            <Main/>
            <Main/>
            <Main/>
            <Main/>

        </div>
    )
}

export default index;
